  const [product, setProduct] = useState(null);

  useEffect(() => {
    async function getProductInfo() {
      const res = await axios.get(`${baseURL}/api/product`, id);
      console.log(res);
    }
    getProductInfo();
  }, [id]);

  return <Layout>product here</Layout>;
};

